INSERT INTO `project_sql` VALUES ('139', '1116944075411857408', '1123098608928333824', 'DROP DATABASE if EXISTS ceshilog;\nCREATE DATABASE ceshilog;\nUSE ceshilog;\ndrop table if exists `order`;\r\n\r\n/*==============================================================*/\r\n/* Table: \"order\"                                               */\r\n/*==============================================================*/\r\ncreate table `order`\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   factoryCode          varchar(64) comment \'工厂编码\',\r\n   order_no             varchar(64) comment \'订单编号\',\r\n   customerCode         varchar(64) comment \'客户编码\',\r\n   item_sku             varchar(64) comment \'产品sku\',\r\n   item_summary         varchar(128) comment \'产品说明\',\r\n   item_total_num       int comment \'产品总量\',\r\n   item_box_num         int comment \'产品箱数\',\r\n   expect_ship_date     datetime comment \'期望出单日期\',\r\n   order_date           varchar(16) comment \'下单日期\',\r\n   ship_time            varchar(16),\r\n   state                varchar(20) comment \'状态：已下单 Order，待发货 Pending_Delivery，已发货Shipped,取消 Cancel,延期 Delay\',\r\n   createTime           datetime comment \'创建时间\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table `order` comment \'订单\';\r\n\r\n\r\ndrop table if exists box;\r\n\r\n/*==============================================================*/\r\n/* Table: box                                                   */\r\n/*==============================================================*/\r\ncreate table box\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   factoryCode          varchar(64) comment \'工厂编码\',\r\n   sn                   varchar(64) not null comment \'箱SN\',\r\n   jobNumber            varchar(32) comment \'员工号\',\r\n   syncState            varchar(16) comment \'同步状态： \r\n            准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced\',\r\n   state                varchar(16) comment \'状态：入库 Storage，已出库 Issue\',\r\n   createTime           datetime comment \'创建时间\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, code, sn)\r\n);\r\n\r\nalter table box comment \'箱库存\';\r\n\r\n\r\ndrop table if exists repair_staff;\r\n\r\n/*==============================================================*/\r\n/* Table: repair_staff                                          */\r\n/*==============================================================*/\r\ncreate table repair_staff\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   email                varchar(64) comment \'邮箱\',\r\n   password             varchar(32) comment \'密码 md5 加密\',\r\n   jobnumber            varchar(16) comment \'工号 0000四位格式\',\r\n   last_name            varchar(32) comment \'姓\',\r\n   first_name           varchar(32) comment \'名\',\r\n   gender               varchar(10) comment \'性别：男 Male，女 Female，其他 Other\',\r\n   avatar               varchar(64) comment \'头像\',\r\n   country_code         varchar(10) comment \'国家代码\',\r\n   language             varchar(16) comment \'语言\',\r\n   timezone             varchar(16) comment \'所在时区\',\r\n   state                varchar(16) comment \'状态：激活[Activate]，冻结[Frozen]，删除[Delete]\',\r\n   createTime           datetime comment \'创建时间\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table repair_staff comment \'维修账户\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('145', '1122747143164551168', '1122747744459972608', 'DROP DATABASE if EXISTS test2;\nCREATE DATABASE test2;\nUSE test2;\ndrop table if exists supplier;\r\n\r\n/*==============================================================*/\r\n/* Table: supplier                                              */\r\n/*==============================================================*/\r\ncreate table supplier\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   name                 varchar(64) comment \'供应商名称 最长32个汉字 64个英文\',\r\n   englishName          varchar(64) comment \'英文名\',\r\n   contacts             varchar(16) comment \'联系人\',\r\n   bank                 varchar(64) comment \'最长32个汉字 64个英文\',\r\n   bank_account         varchar(32) comment \'开户行账户\',\r\n   payment_term         varchar(16) comment \'支付方式 \',\r\n   credit_rating        int comment \'信用等级\',\r\n   supplierCategoryCode varchar(64) comment \'供应商类型编码\',\r\n   website              varchar(128) comment \'公司官网\',\r\n   address              varchar(128) comment \'地址 64个汉字，128个英文字符\',\r\n   english_address      varchar(256) comment \'英文地址\',\r\n   email                varchar(32) comment \'电子邮箱\',\r\n   fax                  varchar(16) comment \'传真号\',\r\n   mobile               varchar(16) comment \'移动电话\',\r\n   telephone            varchar(16) comment \'固定电话\',\r\n   zip_code             varchar(10) comment \'邮编\',\r\n   company_nature       varchar(32) comment \'公司性质 国营 state_run ,民营privately operated，合资joint venture，外资 foreign capital\',\r\n   state                varchar(16) comment \'状态：启用 enable,禁用 disable \r\n            \',\r\n   summary              varchar(256) comment \'备注 128 个汉字说明\',\r\n   createTime           datetime comment \'创建时间\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table supplier comment \'供应商\';\r\n\r\n\r\ndrop table if exists test_unit;\r\n\r\n/*==============================================================*/\r\n/* Table: test_unit                                             */\r\n/*==============================================================*/\r\ncreate table test_unit\r\n(\r\n   id                   bigint not null auto_increment comment \'id\',\r\n   factoryCode          varchar(64) not null comment \'工厂编码\',\r\n   sampleCode           varchar(64) not null comment \'样品编码\',\r\n   factorySN            varchar(64) not null comment \'工厂编码\',\r\n   sn                   varchar(64) not null comment \'产品sn\',\r\n   code                 varchar(64) not null comment \'编码\',\r\n   state                varchar(16) comment \'状态 创建 Create，测试通过TestSuccess，测试失败TestFailed，检修 Repair\',\r\n   syncState            varchar(16) comment \'同步状态：禁止同步 Ban, 准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced \',\r\n   jobnumber            varchar(32),\r\n   createTime           datetime comment \'创建日期\',\r\n   staffCode            varchar(64),\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, factoryCode, sampleCode, factorySN, code)\r\n);\r\n\r\nalter table test_unit comment \'测试件，测试硬件单元\';\r\n\r\n\r\ndrop table if exists repair_feedback;\r\n\r\n/*==============================================================*/\r\n/* Table: repair_feedback                                       */\r\n/*==============================================================*/\r\ncreate table repair_feedback\r\n(\r\n   id                   bigint not null auto_increment comment \'id\',\r\n   factoryCode          varchar(64) not null comment \'工厂编码\',\r\n   code                 varchar(64) not null comment \'维修反馈编码\',\r\n   testUnitCode         varchar(64),\r\n   staffCode            varchar(64) comment \'员工编码\',\r\n   errorCode            varchar(64) comment \'错误类型编码\',\r\n   state                varchar(16) comment \'状态：修复repaired，损坏broken\',\r\n   feedback             varchar(256) comment \'反馈信息\',\r\n   createTime           datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table repair_feedback comment \'维修反馈\';\r\n\r\ndrop table if exists test_record;\r\n\r\n/*==============================================================*/\r\n/* Table: test_record                                           */\r\n/*==============================================================*/\r\ncreate table test_record\r\n(\r\n   id                   bigint not null auto_increment comment \'id\',\r\n   factoryCode          varchar(64) not null comment \'工厂编码\',\r\n   code                 varchar(64) not null comment \'记录编码\',\r\n   staffCode            varchar(64) not null comment \'员工编码\',\r\n   jobNumber            varchar(32) comment \'工号\',\r\n   testUnitCode         varchar(64) comment \'测试件编码\',\r\n   testOptionCode       varchar(64) comment \'测试项编码\',\r\n   staffName            varchar(64) comment \'员工姓名\',\r\n   factorySN            varchar(64) comment \'工厂sn码\',\r\n   testOption           varchar(64) comment \'测试项\',\r\n   state                varchar(64) comment \'状态 成功 TestSuccess，失败 TestFailed\',\r\n   testTime             datetime comment \'测试时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table test_record comment \'检测记录\';\r\n\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('146', '1058961931014316032', '1133516533141241856', 'DROP DATABASE if EXISTS berton;\nCREATE DATABASE berton;\nUSE berton;\nCREATE TABLE `order_trace` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `item_order_code` varchar(64) DEFAULT NULL COMMENT \'订单编码\',\r\n  `order_no` varchar(64) DEFAULT NULL COMMENT \'订单号\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'时间\',\r\n  `customerCode` varchar(64) DEFAULT NULL COMMENT \'客户编码\',\r\n  `customerName` varchar(64) DEFAULT NULL COMMENT \'客户姓名\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'订单追踪\';\r\n\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('147', '1059236585582960640', '1330831282091278336', 'DROP DATABASE if EXISTS pps_cloud_demo;\nCREATE DATABASE pps_cloud_demo;\nUSE pps_cloud_demo;\nCREATE TABLE `battery_aging_test_record` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `testUnitCode` varchar(64) NOT NULL COMMENT \'测试件编码\',\r\n  `sn` varchar(32) NOT NULL COMMENT \'sn\',\r\n  `factoryCode` varchar(32) DEFAULT \'\' COMMENT \'工厂编码\',\r\n  `battery_level` varchar(32) DEFAULT \'\' COMMENT \'电池电量\',\r\n  `tempreture` varchar(32) DEFAULT \'\' COMMENT \'温度\',\r\n  `state` varchar(16) DEFAULT \'\' COMMENT \'状态[正常Normal,异常 Abnormal]\',\r\n  `syncState` varchar(32) DEFAULT NULL COMMENT \'测试同步状态: 准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'测试时间\',\r\n  PRIMARY KEY (`id`,`testUnitCode`,`sn`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'电池老化测试记录\';', 'Enable');
INSERT INTO `project_sql` VALUES ('150', '1124294654241120256', '1321947262498013184', 'DROP DATABASE if EXISTS pps_order;\nCREATE DATABASE pps_order;\nUSE pps_order;\n\n-- ----------------------------\r\n-- Table structure for box\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `box`;\r\nCREATE TABLE `box` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `sn` varchar(64) NOT NULL COMMENT \'箱SN\',\r\n  `jobNumber` varchar(32) DEFAULT NULL COMMENT \'员工号\',\r\n  `syncState` varchar(16) DEFAULT NULL COMMENT \'同步状态： \\r\\n            准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：入库 Storage，已出库 Issue\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`,`code`,`sn`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'箱库存\';\r\n\r\n-- ----------------------------\r\n-- Table structure for box_item\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `box_item`;\r\nCREATE TABLE `box_item` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `testUnitCode` varchar(64) DEFAULT NULL COMMENT \'测试件编码\',\r\n  `box_sn` varchar(64) DEFAULT NULL COMMENT \'箱体SN码\',\r\n  `item_sn` varchar(64) DEFAULT NULL COMMENT \'产品SN码\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'装箱产品\';\r\n\r\n-- ----------------------------\r\n-- Table structure for customer\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `customer`;\r\nCREATE TABLE `customer` (\r\n  `id` bigint(20) NOT NULL,\r\n  `code` varchar(64) DEFAULT NULL COMMENT \'编码\',\r\n  `customer_abbreviation` varchar(64) DEFAULT NULL COMMENT \'客户简称\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'客户名称\',\r\n  `linkman` varchar(64) DEFAULT NULL COMMENT \'联系人\',\r\n  `phone` varchar(32) DEFAULT NULL COMMENT \'电话\',\r\n  `email` varchar(32) DEFAULT NULL COMMENT \'邮箱\',\r\n  `language` varchar(32) DEFAULT NULL COMMENT \'语言\',\r\n  `countryCode` varchar(16) DEFAULT NULL COMMENT \'国家编码\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'客户信息\';\r\n\r\n-- ----------------------------\r\n-- Table structure for order\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `order`;\r\nCREATE TABLE `order` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `order_no` varchar(64) DEFAULT NULL COMMENT \'订单编号\',\r\n  `customerCode` varchar(64) DEFAULT NULL COMMENT \'客户编码\',\r\n  `item_sku` varchar(64) DEFAULT NULL COMMENT \'产品sku\',\r\n  `item_summary` varchar(128) DEFAULT NULL COMMENT \'产品说明\',\r\n  `item_total_num` int(11) DEFAULT NULL COMMENT \'产品总量\',\r\n  `item_box_num` int(11) DEFAULT NULL COMMENT \'产品箱数\',\r\n  `expect_ship_date` datetime DEFAULT NULL COMMENT \'期望出单日期\',\r\n  `order_date` varchar(16) DEFAULT NULL COMMENT \'下单日期\',\r\n  `ship_time` varchar(16) DEFAULT NULL,\r\n  `state` varchar(20) DEFAULT NULL COMMENT \'状态：已下单 Order，待发货 Pending_Delivery，已发货Shipped,取消 Cancel,延期 Delay\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'订单\';\r\n\r\n-- ----------------------------\r\n-- Table structure for order_detail\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `order_detail`;\r\nCREATE TABLE `order_detail` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `orderCode` varchar(64) DEFAULT NULL COMMENT \'订单编码\',\r\n  `box_sn` varchar(64) DEFAULT NULL COMMENT \'箱体SN码\',\r\n  `item_sn` varchar(64) DEFAULT NULL COMMENT \'产品SN\',\r\n  `box_num` varchar(16) DEFAULT NULL COMMENT \'箱号\',\r\n  `item_num` varchar(64) DEFAULT NULL COMMENT \'装箱数量\',\r\n  `linkman` varchar(64) DEFAULT NULL COMMENT \'联系人\',\r\n  `phone` varchar(32) DEFAULT NULL COMMENT \'电话\',\r\n  `email` varchar(32) DEFAULT NULL COMMENT \'邮箱\',\r\n  `address` varchar(128) DEFAULT NULL COMMENT \'地址\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'订单详情\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('152', '1136571749537333248', '1136573673682681856', 'DROP DATABASE if EXISTS displayAndRelation;\nCREATE DATABASE displayAndRelation;\nUSE displayAndRelation;\nCREATE TABLE `display_attribute` (\r\n  `id` bigint(20) NOT NULL,\r\n  `mapFieldColumnCode` varchar(64) NOT NULL COMMENT \'字段编码\',\r\n  `isRequired` varchar(2) DEFAULT NULL COMMENT \'是否必填 Y,N\',\r\n  `isInsert` varchar(2) DEFAULT NULL COMMENT \'是否插入\',\r\n  `isDeleteCondition` varchar(2) DEFAULT NULL COMMENT \'是否是删除条件\',\r\n  `isAllowUpdate` varchar(2) DEFAULT NULL COMMENT \'是否允许修改 Y,N\',\r\n  `isListPageDisplay` varchar(2) DEFAULT NULL COMMENT \'是否分页列表显示 Y,N\',\r\n  `isDetailPageDisplay` varchar(2) DEFAULT NULL COMMENT \'是否详情页显示 Y,N\',\r\n  `isQueryRequired` varchar(2) DEFAULT NULL COMMENT \'是否是查询条件 Y,N\',\r\n  `isLineNew` varchar(2) DEFAULT NULL COMMENT \'是否换行\',\r\n  `matchType` varchar(16) DEFAULT NULL COMMENT \'匹配方式 =,!=,>=,<=,>,<,like,左like，右like,between,in\',\r\n  `displayType` varchar(32) DEFAULT NULL COMMENT \'显示格式 自动完成 Autocomplete,级联选择 Cascader,日期选择框 DatePicker,时间选择 TimePicker,输入框 Input,数字输入框 InputNumber,提及 Mention,邮箱 Email，电话Phone，手机Mobile，备注说明 Summary，选择器 Select，单选 Radio，多选框 Checkbox,评分 Rate,加载展位图 Skeleton,滑动输入条 Silder，开关 Switch,穿梭框 Transfer,选择树 TreeSelect ,上传 Upload,头像 Avatar\',\r\n  `displayName` varchar(64) DEFAULT NULL COMMENT \'显示列名称\',\r\n  `displayNo` int(11) DEFAULT NULL COMMENT \'显示顺序\',\r\n  `fieldValidationMode` varchar(32) DEFAULT NULL COMMENT \'字段验证方式\',\r\n  `validateText` varchar(64) DEFAULT NULL COMMENT \'验证提示语\',\r\n  `displayCss` varchar(32) DEFAULT NULL COMMENT \'显示css样式\',\r\n  PRIMARY KEY (`id`,`mapFieldColumnCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'显示属性\';\r\n\r\ndrop table if exists module_file;\r\n\r\ndrop table if exists project_model;\r\n\r\n/*==============================================================*/\r\n/* Table: project_model                                         */\r\n/*==============================================================*/\r\ncreate table project_model\r\n(\r\n   id                   bigint not null,\r\n   code                 varchar(64) not null comment \'模块编码\',\r\n   pre_code             varchar(64) comment \'上级模块编码\',\r\n   name                 varchar(64) comment \'模块显示名称\',\r\n   route                varchar(64) comment \'模块路由\',\r\n   css                  varchar(32) comment \'模块css样式\',\r\n   is_menu              varchar(2) comment \'是否是菜单 Y,N\',\r\n   ico                  varchar(64) comment \'模块图标\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table project_model comment \'模块\';\r\n\r\ndrop table if exists project_model_class;\r\n\r\n/*==============================================================*/\r\n/* Table: project_model_class                                   */\r\n/*==============================================================*/\r\ncreate table project_model_class\r\n(\r\n   id                   bigint not null,\r\n   mapClassTableCode    varchar(64) not null comment \'类编码\',\r\n   projectModelCode     varchar(64) not null comment \'模块编码\',\r\n   primary key (id, mapClassTableCode, projectModelCode)\r\n);\r\n\r\nalter table project_model_class comment \'模块下的类\';\r\n\r\n\r\ndrop table if exists display_attribute;\r\n\r\n/*==============================================================*/\r\n/* Table: display_attribute                                     */\r\n/*==============================================================*/\r\ncreate table display_attribute\r\n(\r\n   id                   bigint not null,\r\n   mapFieldColumnCode   varchar(64) not null comment \'字段编码\',\r\n   isRequired           varchar(2) comment \'是否必填 Y,N\',\r\n   isInsert             varchar(2) comment \'是否插入\',\r\n   isDeleteCondition    varchar(2) comment \'是否是删除条件\',\r\n   isAllowUpdate        varchar(2) comment \'是否允许修改 Y,N\',\r\n   isListPageDisplay    varchar(2) comment \'是否分页列表显示 Y,N\',\r\n   isDetailPageDisplay  varchar(2) comment \'是否详情页显示 Y,N\',\r\n   isQueryRequired      varchar(2) comment \'是否是查询条件 Y,N\',\r\n   isLineNew            varchar(2) comment \'是否换行\',\r\n   matchType            varchar(16) comment \'匹配方式 =,!=,>=,<=,>,<,like,左like，右like,between,in\',\r\n   displayType          varchar(32) comment \'显示格式 自动完成 Autocomplete,级联选择 Cascader,日期选择框 DatePicker,时间选择 TimePicker,输入框 Input,数字输入框 InputNumber,提及 Mention,邮箱 Email，电话Phone，手机Mobile，备注说明 Summary，选择器 Select，单选 Radio，多选框 Checkbox,评分 Rate,加载展位图 Skeleton,滑动输入条 Silder，开关 Switch,穿梭框 Transfer,选择树 TreeSelect ,上传 Upload,头像 Avatar\',\r\n   displayName          varchar(64) comment \'显示列名称\',\r\n   displayNo            int comment \'显示顺序\',\r\n   fieldValidationMode  varchar(32) comment \'字段验证方式\',\r\n   validateText         varchar(64) comment \'验证提示语\',\r\n   displayCss           varchar(32) comment \'显示css样式\',\r\n   primary key (id, mapFieldColumnCode)\r\n);\r\n\r\nalter table display_attribute comment \'显示属性\';\r\n\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('154', '1148428590873993216', '1148428693953208320', 'DROP DATABASE if EXISTS atmosphere;\nCREATE DATABASE atmosphere;\nUSE atmosphere;\nCREATE TABLE `account` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `account` varchar(64) NOT NULL COMMENT \'账户\',\r\n  `password` varchar(64) DEFAULT NULL COMMENT \'密码\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `language` varchar(16) DEFAULT \'\' COMMENT \'语言偏向\',\r\n  PRIMARY KEY (`id`,`code`,`account`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COMMENT=\'账户\';', 'Enable');
INSERT INTO `project_sql` VALUES ('155', '1168895948285599744', '1322017906120097792', 'DROP DATABASE if EXISTS pps_cloud_support_ui;\nCREATE DATABASE pps_cloud_support_ui;\nUSE pps_cloud_support_ui;\n\r\n\r\n\r\n\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for errorcode_local\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `errorcode_local`;\r\nCREATE TABLE `errorcode_local` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `sceneCode` varchar(64) DEFAULT NULL COMMENT \'场景编码\',\r\n  `errorCode` varchar(64) DEFAULT NULL COMMENT \'错误码\',\r\n  `language` varchar(16) DEFAULT NULL COMMENT \'语言 如 英语，普通话，法语等\',\r\n  `info` varchar(128) DEFAULT NULL COMMENT \'文本对照 中文，英语，法语等等具体的文本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8mb4 COMMENT=\'错误码本地化，将对应国际化进行配置\';\r\n\r\n-- ----------------------------\r\n-- Table structure for errorcode_pool\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `errorcode_pool`;\r\nCREATE TABLE `errorcode_pool` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `errorCode` varchar(32) NOT NULL COMMENT \'错误码 由人为定义并制定出来指定一定场景模块的错误编码\',\r\n  `info` varchar(64) DEFAULT NULL COMMENT \'文本对照,默认的错误信息提示\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'错误码说明解释错误码的作用和表达意思\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态： 启用 enable,禁用 disable\',\r\n  PRIMARY KEY (`id`,`errorCode`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COMMENT=\'错误码库\';\r\n\r\n-- ----------------------------\r\n-- Table structure for frontend_i18n\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `frontend_i18n`;\r\nCREATE TABLE `frontend_i18n` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) DEFAULT NULL COMMENT \'编码\',\r\n  `fronendCatetoryCode` varchar(64) DEFAULT NULL COMMENT \'前端国际化分类编码\',\r\n  `i18nKey` varchar(32) DEFAULT NULL COMMENT \'国际化键\',\r\n  `i18nValue` varchar(128) DEFAULT NULL COMMENT \'国际化文本内容\',\r\n  `language` varchar(16) DEFAULT NULL COMMENT \'语言\',\r\n  `state` char(10) DEFAULT NULL COMMENT \'状态： 启用 enable,禁用 disable\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1522 DEFAULT CHARSET=utf8mb4 COMMENT=\'前端国际化\';\r\n\r\n-- ----------------------------\r\n-- Table structure for frontend_i18n_category\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `frontend_i18n_category`;\r\nCREATE TABLE `frontend_i18n_category` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'国际化分类名\',\r\n  `prefix` varchar(32) DEFAULT NULL COMMENT \'国际化分类编码前缀\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：启用 enable,禁用 disable\',\r\n  `summary` varchar(256) DEFAULT NULL COMMENT \'说明 128个字以内\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT=\'前端国际化分类\';\r\n\r\n-- ----------------------------\r\n-- Table structure for setting\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `setting`;\r\nCREATE TABLE `setting` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `k` varchar(64) NOT NULL COMMENT \'键\',\r\n  `v` varchar(128) DEFAULT NULL COMMENT \'值\',\r\n  `summary` varchar(256) DEFAULT NULL COMMENT \'备注 128个汉字\',\r\n  `ver` int(11) DEFAULT 1 COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`k`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COMMENT=\'设置\';', 'Enable');
INSERT INTO `project_sql` VALUES ('156', '1197090587517722624', '1197090845215760384', 'DROP DATABASE if EXISTS webide;\nCREATE DATABASE webide;\nUSE webide;\n\r\nCREATE TABLE `account` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) NOT NULL COMMENT \'����\',\r\n  `account` varchar(64) NOT NULL COMMENT \'�˻�\',\r\n  `password` varchar(64) DEFAULT NULL COMMENT \'����\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'״̬\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'����ʱ��\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'����ʱ��\',\r\n  `language` varchar(16) DEFAULT \'\' COMMENT \'����ƫ��\',\r\n  PRIMARY KEY (`id`,`code`,`account`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COMMENT=\'�˻�\';\r\nCREATE TABLE `worker_node` (\r\n  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'auto increment id\',\r\n  `HOST_NAME` varchar(64) NOT NULL COMMENT \'host name\',\r\n  `PORT` varchar(64) NOT NULL COMMENT \'port\',\r\n  `TYPE` int(11) NOT NULL COMMENT \'node type: ACTUAL or CONTAINER\',\r\n  `LAUNCH_DATE` date NOT NULL COMMENT \'launch date\',\r\n  `MODIFIED` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT \'modified time\',\r\n  `CREATED` timestamp NOT NULL DEFAULT \'0000-00-00 00:00:00\' COMMENT \'created time\',\r\n  PRIMARY KEY (`ID`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1263 DEFAULT CHARSET=utf8 COMMENT=\'DB WorkerID Assigner for UID Generator\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('157', '1197096737910890496', '1197097287666704384', 'DROP DATABASE if EXISTS webidetest;\nCREATE DATABASE webidetest;\nUSE webidetest;\nCREATE TABLE `box` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `sn` varchar(64) NOT NULL COMMENT \'箱SN\',\r\n  `factoryCode` varchar(64) DEFAULT \'\' COMMENT \'工厂编码\',\r\n  `jobNumber` varchar(32) DEFAULT NULL COMMENT \'员工号\',\r\n  `syncState` varchar(16) DEFAULT NULL COMMENT \'同步状态：准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：入库 Storage，已出库 Issue\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`,`code`,`sn`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8mb4 COMMENT=\'箱库存\';\r\n\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('158', '1210378546316656640', '1210378975813386240', 'DROP DATABASE if EXISTS smart_plant_iot_localserver;\nCREATE DATABASE smart_plant_iot_localserver;\nUSE smart_plant_iot_localserver;\n\r\n/*==============================================================*/\r\n/* Table: B                                                     */\r\n/*==============================================================*/\r\ncreate table B\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table B comment \'传感器B表\';\r\n\r\n/*==============================================================*/\r\n/* Table: air_quality_sensor                                    */\r\n/*==============================================================*/\r\ncreate table air_quality_sensor\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table air_quality_sensor comment \'空气质量传感器\';\r\n\r\n/*==============================================================*/\r\n/* Table: cpu_monitoring                                        */\r\n/*==============================================================*/\r\ncreate table cpu_monitoring\r\n(\r\n   id                   integer(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   machine_code         varchar(32) comment \'机器编码\',\r\n   usage_rate           varchar(32) comment \'使用率\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table cpu_monitoring comment \'CPU监控记录\';\r\n\r\n/*==============================================================*/\r\n/* Table: humidity_sensor                                       */\r\n/*==============================================================*/\r\ncreate table humidity_sensor\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table humidity_sensor comment \'湿度传感器\';\r\n\r\n/*==============================================================*/\r\n/* Table: humidity_temp_sensor                                  */\r\n/*==============================================================*/\r\ncreate table humidity_temp_sensor\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   humidity             varchar(64) comment \'湿度\',\r\n   temp                 varchar(64) comment \'温度\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table humidity_temp_sensor comment \'温湿度传感器\';\r\n\r\n/*==============================================================*/\r\n/* Table: machine                                               */\r\n/*==============================================================*/\r\ncreate table machine\r\n(\r\n   id                   integer(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   name                 varchar(32) comment \'名称\',\r\n   model_number         varchar(32) comment \'型号\',\r\n   system_version       varchar(32) comment \'系统版本\',\r\n   produced_date        datetime comment \'生产日期\',\r\n   CPU                  varchar(16) comment \'CPU\',\r\n   RAM                  varchar(16) comment \'RAM\',\r\n   state                varchar(16) comment \'在线状态：online 在线；offline 下线\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table machine comment \'机器设备表\';\r\n\r\n/*==============================================================*/\r\n/* Table: machine_logs                                          */\r\n/*==============================================================*/\r\ncreate table machine_logs\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   machine_code         varchar(32) comment \'机器编码\',\r\n   info                 varchar(1024) comment \'日志信息\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table machine_logs comment \'机器日志表\';\r\n\r\n/*==============================================================*/\r\n/* Table: ph_sensor                                             */\r\n/*==============================================================*/\r\ncreate table ph_sensor\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table ph_sensor comment \'PH值传感器\';\r\n\r\n/*==============================================================*/\r\n/* Table: ram_monitoring                                        */\r\n/*==============================================================*/\r\ncreate table ram_monitoring\r\n(\r\n   id                   integer(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   machine_code         varchar(32) comment \'机器编码\',\r\n   usage_rate           varchar(32) comment \'使用率\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table ram_monitoring comment \'内存监控记录\';\r\n\r\n/*==============================================================*/\r\n/* Table: setting                                               */\r\n/*==============================================================*/\r\ncreate table setting\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   v                    varchar(64) comment \'值\',\r\n   primary key (id)\r\n);\r\n\r\nalter table setting comment \'基本配置表\';\r\n\r\n/*==============================================================*/\r\n/* Table: temp_sensor                                           */\r\n/*==============================================================*/\r\ncreate table temp_sensor\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   k                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table temp_sensor comment \'温度传感器\';\r\n\r\n/*==============================================================*/\r\n/* Table: temperature_monitoring                                */\r\n/*==============================================================*/\r\ncreate table temperature_monitoring\r\n(\r\n   id                   integer(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   machine_code         varchar(32) comment \'机器编码\',\r\n   temperature          varchar(32) comment \'温度\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table temperature_monitoring comment \'温度监控记录\';\r\n\r\n/*==============================================================*/\r\n/* Table: watering_record                                       */\r\n/*==============================================================*/\r\ncreate table watering_record\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   code                 varchar(32) not null comment \'编码\',\r\n   machine_code         varchar(32) comment \'机器编码\',\r\n   quantities           varchar(64) comment \'浇水量\',\r\n   create_time          datetime comment \'创建时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table watering_record comment \'浇水记录\';\r\n', 'Enable');
