INSERT INTO `project_sql` VALUES ('160', '1210429982844993536', '1210851267597123584', 'DROP DATABASE if EXISTS plant;\nCREATE DATABASE plant;\nUSE plant;\ndrop table if exists sensor_barometer;\r\n\r\n/*==============================================================*/\r\n/* Table: sensor_barometer                                      */\r\n/*==============================================================*/\r\ncreate table sensor_barometer\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   pressure             varchar(64) comment \'压强\',\r\n   temp                 varchar(64) comment \'温度\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table sensor_barometer comment \'温度压强传感器数据表\';\r\ndrop table if exists sensor_moisture;\r\n\r\n/*==============================================================*/\r\n/* Table: sensor_moisture                                       */\r\n/*==============================================================*/\r\ncreate table sensor_moisture\r\n(\r\n   id                   bigint(20) not null auto_increment,\r\n   v                    varchar(64) comment \'键\',\r\n   state                varchar(64) comment \'值\',\r\n   create_time          datetime,\r\n   primary key (id)\r\n);\r\n\r\nalter table sensor_moisture comment \'土壤湿度传感器数据表\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('161', '1210764011041538048', '1321987136974389248', 'DROP DATABASE if EXISTS smart_plant;\nCREATE DATABASE smart_plant;\nUSE smart_plant;\n\r\n-- ----------------------------\r\n-- Table structure for sample\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `sample`;\r\nCREATE TABLE `sample` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT \'名字\',\r\n  `ver` int(11) DEFAULT 1 COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8mb4 COMMENT=\'样本\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('164', '1268517491378216960', '1268518247292461056', 'DROP DATABASE if EXISTS pps_minder;\nCREATE DATABASE pps_minder;\nUSE pps_minder;\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for box\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `box`;\r\nCREATE TABLE `box` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `sn` varchar(64) NOT NULL COMMENT \'箱SN\',\r\n  `jobNumber` varchar(32) DEFAULT NULL COMMENT \'员工号\',\r\n  `syncState` varchar(16) DEFAULT NULL COMMENT \'同步状态： \\r\\n            准备同步 Ready,同步中 Sync,同步错误 Error,已经同步 Synced\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：入库 Storage，已出库 Issue\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`,`code`,`sn`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'箱库存\';', 'Enable');
INSERT INTO `project_sql` VALUES ('166', '1311392363187806208', '1319361486027276288', 'DROP DATABASE if EXISTS test222;\nCREATE DATABASE test222;\nUSE test222;\n\r\n\r\n\r\n\r\nCREATE TABLE `account` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `code` varchar(64) NOT NULL COMMENT \'����\',\r\n  `account` varchar(64) NOT NULL COMMENT \'�˻�\',\r\n  `password` varchar(64) DEFAULT NULL COMMENT \'����\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'״̬\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'����ʱ��\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'����ʱ��\',\r\n  `language` varchar(16) DEFAULT \'\' COMMENT \'����ƫ��\',\r\n  PRIMARY KEY (`id`,`code`,`account`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COMMENT=\'�˻�\';\r\nCREATE TABLE `worker_node` (\r\n  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'auto increment id\',\r\n  `HOST_NAME` varchar(64) NOT NULL COMMENT \'host name\',\r\n  `PORT` varchar(64) NOT NULL COMMENT \'port\',\r\n  `TYPE` int(11) NOT NULL COMMENT \'node type: ACTUAL or CONTAINER\',\r\n  `LAUNCH_DATE` date NOT NULL COMMENT \'launch date\',\r\n  `MODIFIED` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT \'modified time\',\r\n  `CREATED` timestamp NOT NULL DEFAULT \'0000-00-00 00:00:00\' COMMENT \'created time\',\r\n  PRIMARY KEY (`ID`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1263 DEFAULT CHARSET=utf8 COMMENT=\'DB WorkerID Assigner for UID Generator\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('172', '1329446945412235264', '1329454453015076864', 'DROP DATABASE if EXISTS bom;\nCREATE DATABASE bom;\nUSE bom;\n\r\n\r\n\r\n\r\n/*\r\nNavicat MySQL Data Transfer\r\n\r\nSource Server         : 220\r\nSource Server Version : 50505\r\nSource Host           : 192.168.1.220:3306\r\nSource Database       : bom\r\n\r\nTarget Server Type    : MYSQL\r\nTarget Server Version : 50505\r\nFile Encoding         : 65001\r\n\r\nDate: 2019-03-04 15:07:10\r\n*/\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for assembly\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `assembly`;\r\nCREATE TABLE `assembly` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `categoryCode` varchar(64) DEFAULT NULL COMMENT \'组件类型编码\',\r\n  `preCode` varchar(64) DEFAULT NULL COMMENT \'上级编码\',\r\n  `level` int(11) DEFAULT NULL COMMENT \'子级级别\',\r\n  `assemblyCode` varchar(64) DEFAULT NULL COMMENT \'组件代码\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'命名\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：[开发Develop，稳定Stable，停用 Stop]\',\r\n  `designFileCode` varchar(64) DEFAULT NULL COMMENT \'图纸编号\',\r\n  `designFileUrl` varchar(128) DEFAULT NULL COMMENT \'图纸地址\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'说明\',\r\n  `ver` int(11) DEFAULT NULL COMMENT \'组件版本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'组件\';\r\n\r\n-- ----------------------------\r\n-- Table structure for assembly_category\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `assembly_category`;\r\nCREATE TABLE `assembly_category` (\r\n  `id` int(11) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `preCode` varchar(64) DEFAULT NULL COMMENT \'上级编码\',\r\n  `level` int(11) DEFAULT NULL COMMENT \'上级级别\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'类型名\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'描述\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态[启用 enable,禁用 disable]\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'组件类型\';\r\n\r\n-- ----------------------------\r\n-- Table structure for assembly_log\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `assembly_log`;\r\nCREATE TABLE `assembly_log` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `assemblyCode` varchar(64) DEFAULT NULL COMMENT \'组件编码\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件定义[修改 Update,删除 Delete,创建 Create,复制 Copy,禁用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(64) DEFAULT NULL COMMENT \'操作人\',\r\n  `summary` varchar(512) DEFAULT NULL COMMENT \'日志描述\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'组件日志\';\r\n\r\n-- ----------------------------\r\n-- Table structure for assembly_material\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `assembly_material`;\r\nCREATE TABLE `assembly_material` (\r\n  `id` bigint(20) NOT NULL,\r\n  `assemblyCode` varchar(64) NOT NULL COMMENT \'组件编码\',\r\n  `materialCode` varchar(64) NOT NULL COMMENT \'物料编码\',\r\n  PRIMARY KEY (`id`,`assemblyCode`,`materialCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'构成组件的物料\';\r\n\r\n-- ----------------------------\r\n-- Table structure for bom\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `bom`;\r\nCREATE TABLE `bom` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `preCode` varchar(64) DEFAULT NULL COMMENT \'上级编码\',\r\n  `level` int(11) DEFAULT NULL COMMENT \'子级级别\',\r\n  `bomCode` varchar(64) DEFAULT NULL COMMENT \'bom代码\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'名称\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'说明\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态[开发Develop，稳定Stable，停用 Stop]\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `ver` int(11) DEFAULT NULL COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'bom\';\r\n\r\n-- ----------------------------\r\n-- Table structure for bom_detail\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `bom_detail`;\r\nCREATE TABLE `bom_detail` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `bomCode` varchar(64) DEFAULT NULL COMMENT \'bom编码\',\r\n  `supplierCode` varchar(64) DEFAULT NULL COMMENT \'供应商编码\',\r\n  `materialAssemblyCode` varchar(64) DEFAULT NULL COMMENT \'物料或组件编码\',\r\n  `type` varchar(16) DEFAULT NULL COMMENT \'类型[物料 Material ,组件 Assembly]\',\r\n  `state` char(10) DEFAULT NULL COMMENT \'状态：[开发Develop，稳定Stable，停用 Stop]\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'零件名\',\r\n  `num` varchar(16) DEFAULT NULL COMMENT \'用量\',\r\n  `position` varchar(16) DEFAULT NULL COMMENT \'位置\',\r\n  `material` varchar(16) DEFAULT NULL COMMENT \'材料\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'描述\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'bom明细\';\r\n\r\n-- ----------------------------\r\n-- Table structure for bom_detail_log\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `bom_detail_log`;\r\nCREATE TABLE `bom_detail_log` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `bomDetailCode` varchar(64) DEFAULT NULL COMMENT \'bom明细编码\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件定义[修改 Update,删除 Delete,创建 Create,复制 Copy,禁用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(64) DEFAULT NULL COMMENT \'操作人\',\r\n  `summary` varchar(512) DEFAULT NULL COMMENT \'日志描述\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'bom明细日志\';\r\n\r\n-- ----------------------------\r\n-- Table structure for bom_log\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `bom_log`;\r\nCREATE TABLE `bom_log` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `bomCode` varchar(64) DEFAULT NULL COMMENT \'bom编码\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件定义[修改 Update,删除 Delete,创建 Create,复制 Copy,禁用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(64) DEFAULT NULL COMMENT \'操作人\',\r\n  `summary` varchar(512) DEFAULT NULL COMMENT \'日志描述\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'bom日志\';\r\n\r\n-- ----------------------------\r\n-- Table structure for material\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `material`;\r\nCREATE TABLE `material` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'物料\',\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `num` varchar(16) DEFAULT NULL COMMENT \'编号\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'名称\',\r\n  `specifications` varchar(16) DEFAULT NULL COMMENT \'规格 厘米，克等计量单位\',\r\n  `brandCode` varchar(64) DEFAULT NULL COMMENT \'品牌编码\',\r\n  `materialCategoryCode` varchar(64) DEFAULT NULL COMMENT \'材料类型编码\',\r\n  `image_url` varchar(64) DEFAULT NULL COMMENT \'图片地址\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'描述 64个汉字描述\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：启用 enable,禁用 disable\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `factory_code` varchar(32) DEFAULT NULL COMMENT \'原厂型号编号\',\r\n  `material_verion` varchar(10) DEFAULT NULL COMMENT \'物料版本号\',\r\n  `star` int(11) DEFAULT NULL COMMENT \'供应料星级\',\r\n  `fob` varchar(10) DEFAULT \'0.00\' COMMENT \'价格\',\r\n  `untaxed_price` varchar(10) DEFAULT \'0.00\' COMMENT \'未税价格\',\r\n  `tax_price` varchar(10) DEFAULT \'0.00\' COMMENT \'含税价格\',\r\n  `dollar_price` varchar(10) DEFAULT \'0.00\' COMMENT \'美金价格\',\r\n  `tax_rate` varchar(10) DEFAULT \'\' COMMENT \'税率\',\r\n  `moq` int(11) DEFAULT NULL COMMENT \'最小订货量 MOQ\',\r\n  `cycle_time` varchar(10) DEFAULT NULL COMMENT \'生产周期\',\r\n  `materialUnit` varchar(255) DEFAULT \'\' COMMENT \'单位\',\r\n  `materialCurrency` varchar(255) DEFAULT \'\' COMMENT \'货币\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 COMMENT=\'供应料材\';\r\n\r\n-- ----------------------------\r\n-- Table structure for material_log\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `material_log`;\r\nCREATE TABLE `material_log` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `materialCode` varchar(64) DEFAULT NULL COMMENT \'物料编码\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件定义[修改 Update,删除 Delete,创建 Create,复制 Copy,禁用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(64) DEFAULT NULL COMMENT \'操作人\',\r\n  `summary` varchar(512) DEFAULT NULL COMMENT \'日志描述\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'物料日志\';\r\n\r\n-- ----------------------------\r\n-- Table structure for mould\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `mould`;\r\nCREATE TABLE `mould` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'名称\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'说明\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：[开发Develop，稳定Stable，停用 Stop]\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'模具\';\r\n\r\n-- ----------------------------\r\n-- Table structure for mould_material\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `mould_material`;\r\nCREATE TABLE `mould_material` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `materialCode` varchar(64) NOT NULL COMMENT \'物料编码\',\r\n  `mouldCode` varchar(64) NOT NULL COMMENT \'模具编码\',\r\n  PRIMARY KEY (`id`,`materialCode`,`mouldCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'物料模具关联\';\r\n\r\n-- ----------------------------\r\n-- Table structure for product\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `product`;\r\nCREATE TABLE `product` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `alias` varchar(32) DEFAULT NULL COMMENT \'成品别名\',\r\n  `sku` varchar(64) DEFAULT NULL COMMENT \'SKU\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(32) DEFAULT NULL COMMENT \'操作人姓名\',\r\n  `makerName` varchar(32) DEFAULT NULL COMMENT \'制定人姓名\',\r\n  `makerEmail` varchar(32) DEFAULT NULL COMMENT \'制定人邮箱\',\r\n  `state` varchar(32) DEFAULT NULL COMMENT \'状态：[创建 Create,开发中 Developing,生产中 Producting,发货中 Delivery，完成 Done,取消 Cancel]\',\r\n  `num` int(11) DEFAULT NULL COMMENT \'数量\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'说明\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `ver` int(11) DEFAULT NULL COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'成品\';\r\n\r\n-- ----------------------------\r\n-- Table structure for product_bom\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `product_bom`;\r\nCREATE TABLE `product_bom` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `productCode` varchar(64) NOT NULL COMMENT \'成品编码\',\r\n  `bomCode` varchar(64) NOT NULL COMMENT \'bom编码\',\r\n  PRIMARY KEY (`id`,`productCode`,`bomCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'销售bom关联\';\r\n\r\n-- ----------------------------\r\n-- Table structure for project\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `project`;\r\nCREATE TABLE `project` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `preCode` varchar(64) DEFAULT NULL COMMENT \'上级编码\',\r\n  `level` int(11) DEFAULT NULL COMMENT \'自己级别\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'项目名\',\r\n  `projectCode` varchar(64) DEFAULT NULL COMMENT \'项目代码\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'项目说明\',\r\n  `startTime` datetime DEFAULT NULL COMMENT \'开始时间\',\r\n  `endTime` datetime DEFAULT NULL COMMENT \'结束时间\',\r\n  `state` char(10) DEFAULT NULL COMMENT \'状态[开发Develop，稳定Stable，停用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'创建人编码\',\r\n  `operateName` varchar(32) DEFAULT NULL COMMENT \'创建人\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `ver` int(11) DEFAULT NULL COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'项目\';\r\n\r\n-- ----------------------------\r\n-- Table structure for project_bom\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `project_bom`;\r\nCREATE TABLE `project_bom` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `projectCode` varchar(64) NOT NULL COMMENT \'项目编码\',\r\n  `bomCode` varchar(64) NOT NULL COMMENT \'bom编码\',\r\n  PRIMARY KEY (`id`,`projectCode`,`bomCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'项目bom关联\';\r\n\r\n-- ----------------------------\r\n-- Table structure for project_log\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `project_log`;\r\nCREATE TABLE `project_log` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `projectCode` varchar(64) DEFAULT NULL COMMENT \'项目编码\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件定义[修改 Update,删除 Delete,创建 Create,复制 Copy,禁用 Stop]\',\r\n  `operateCode` varchar(64) DEFAULT NULL COMMENT \'操作人编码\',\r\n  `operateName` varchar(64) DEFAULT NULL COMMENT \'操作人\',\r\n  `summary` varchar(512) DEFAULT NULL COMMENT \'日志描述\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'项目变更日志\';\r\n\r\nCREATE TABLE `material` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'物料\',\r\n  `code` varchar(64) NOT NULL COMMENT \'编码\',\r\n  `num` varchar(16) DEFAULT NULL COMMENT \'编号\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'名称\',\r\n  `specifications` varchar(16) DEFAULT NULL COMMENT \'规格 厘米，克等计量单位\',\r\n  `brandCode` varchar(64) DEFAULT NULL COMMENT \'品牌编码\',\r\n  `materialCategoryCode` varchar(64) DEFAULT NULL COMMENT \'材料类型编码\',\r\n  `image_url` varchar(64) DEFAULT NULL COMMENT \'图片地址\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'描述 64个汉字描述\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'状态：启用 enable,禁用 disable\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  `updateTime` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  `factory_code` varchar(32) DEFAULT NULL COMMENT \'原厂型号编号\',\r\n  `material_verion` varchar(10) DEFAULT NULL COMMENT \'物料版本号\',\r\n  `star` int(11) DEFAULT NULL COMMENT \'供应料星级\',\r\n  `fob` varchar(10) DEFAULT \'0.00\' COMMENT \'价格\',\r\n  `untaxed_price` varchar(10) DEFAULT \'0.00\' COMMENT \'未税价格\',\r\n  `tax_price` varchar(10) DEFAULT \'0.00\' COMMENT \'含税价格\',\r\n  `dollar_price` varchar(10) DEFAULT \'0.00\' COMMENT \'美金价格\',\r\n  `tax_rate` varchar(10) DEFAULT \'\' COMMENT \'税率\',\r\n  `moq` int(11) DEFAULT NULL COMMENT \'最小订货量 MOQ\',\r\n  `cycle_time` varchar(10) DEFAULT NULL COMMENT \'生产周期\',\r\n  `materialUnit` varchar(255) DEFAULT \'\' COMMENT \'单位\',\r\n  `materialCurrency` varchar(255) DEFAULT \'\' COMMENT \'货币\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8mb4 COMMENT=\'供应料材\';\r\n\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('173', '1329459297738186752', '1357615350984245248', 'DROP DATABASE if EXISTS pps_bom;\nCREATE DATABASE pps_bom;\nUSE pps_bom;\ndrop table if exists assembly_image;\r\n\r\n/*==============================================================*/\r\n/* Table: assembly_image                                        */\r\n/*==============================================================*/\r\ncreate table assembly_image\r\n(\r\n   id                   bigint not null auto_increment,\r\n   assemblyCode         varchar(64) not null comment \'组件编码\',\r\n   code                 varchar(64) not null comment \'图纸编码\',\r\n   path                 varchar(128) comment \'图纸地址\',\r\n   summary              varchar(128) comment \'备注 最多64汉字，128英文字符\',\r\n   primary key (id, assemblyCode, code)\r\n);\r\n\r\nalter table assembly_image comment \'设计图库\';', 'Enable');
INSERT INTO `project_sql` VALUES ('176', '1329571413564489728', '1329582322781454336', 'DROP DATABASE if EXISTS ppstest;\nCREATE DATABASE ppstest;\nUSE ppstest;\n\r\n\r\n\r\n\r\ncreate table battery_aging_test_record\r\n(\r\n   id                   bigint not null auto_increment,\r\n   testUnitCode         varchar(64) not null comment \'测试件编码\',\r\n   sn                   varchar(32) not null comment \'sn\',\r\n   battery_level        varchar(32) comment \'电池电量\',\r\n   tempreture           varchar(32) comment \'温度\',\r\n   state                varchar(16) comment \'状态[正常Normal,异常 Abnormal]\',\r\n   createTime           datetime comment \'测试时间\',\r\n   primary key (id, testUnitCode, sn)\r\n);\r\nalter table battery_aging_test_record comment \'电池老化测试记录\';\r\ncreate table aging_test_option\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   option             varchar(32) comment \'测试项\',\r\n   router               varchar(32) comment \'路由\',\r\n   state                varchar(16) comment \'状态[启用 enable,禁用 disable]\',\r\n   sort                 int comment \'测试排序\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id, code)\r\n);\r\n\r\nalter table aging_test_option comment \'老化测试项\';', 'Enable');
INSERT INTO `project_sql` VALUES ('177', '1329571413564489728', '1329574042084483072', 'DROP DATABASE if EXISTS ppstest;\nCREATE DATABASE ppstest;\nUSE ppstest;\ncreate table battery_aging_test_record\r\n(\r\n   id                   bigint not null auto_increment,\r\n   testUnitCode         varchar(64) not null comment \'测试件编码\',\r\n   sn                   varchar(32) not null comment \'sn\',\r\n   battery_level        varchar(32) comment \'电池电量\',\r\n   tempreture           varchar(32) comment \'温度\',\r\n   state                varchar(16) comment \'状态[正常Normal,异常 Abnormal]\',\r\n   createTime           datetime comment \'测试时间\',\r\n   primary key (id, testUnitCode, sn)\r\n);\r\ncreate table aging_test_option\r\n(\r\n   id                   bigint not null auto_increment,\r\n   option            varchar(32) comment \'测试项\',\r\n   router               varchar(32) comment \'路由\',\r\n   state                varchar(16) comment \'状态[启用 enable,禁用 disable]\',\r\n   sort                 int comment \'测试排序\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   primary key (id)\r\n);', 'Enable');
INSERT INTO `project_sql` VALUES ('178', '1333796493152706560', '1333796871109828608', 'DROP DATABASE if EXISTS ide;\nCREATE DATABASE ide;\nUSE ide;\nCREATE TABLE `device` (\r\n  `id` int(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(32) NOT NULL COMMENT \'编码\',\r\n  `name` varchar(32) DEFAULT NULL COMMENT \'名称\',\r\n  `model_number` varchar(32) DEFAULT NULL COMMENT \'型号\',\r\n  `system_version` varchar(32) DEFAULT NULL COMMENT \'系统版本\',\r\n  `produced_date` datetime DEFAULT NULL COMMENT \'生产日期\',\r\n  `CPU` varchar(16) DEFAULT NULL COMMENT \'CPU\',\r\n  `RAM` varchar(16) DEFAULT NULL COMMENT \'RAM\',\r\n  `state` varchar(16) DEFAULT NULL COMMENT \'在线状态：online 在线；offline 下线\',\r\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COMMENT=\'机器设备表\';\r\n\r\nCREATE TABLE `device_cpu_monitoring` (\r\n  `id` int(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(32) CHARACTER SET utf8mb4 NOT NULL COMMENT \'编码\',\r\n  `uuid` varchar(32) CHARACTER SET utf8mb4 DEFAULT \'\',\r\n  `device_code` varchar(32) CHARACTER SET utf8mb4 DEFAULT \'\' COMMENT \'机器编码\',\r\n  `usage_rate` varchar(32) CHARACTER SET utf8mb4 DEFAULT \'\' COMMENT \'使用率\',\r\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=232631 DEFAULT CHARSET=latin1 COMMENT=\'CPU监控记录\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('179', '1334048075157037056', '1334163025661747200', 'DROP DATABASE if EXISTS jv_rover;\nCREATE DATABASE jv_rover;\nUSE jv_rover;\ndrop table if exists code_base;\r\n\r\ndrop table if exists device_history;\r\n\r\ndrop table if exists device_pool;\r\n\r\ndrop table if exists school;\r\n\r\ndrop table if exists school_wifi;\r\n\r\ndrop table if exists setting;\r\n\r\n/*==============================================================*/\r\n/* Table: code_base                                             */\r\n/*==============================================================*/\r\ncreate table code_base\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   name                 varchar(32) comment \'代码名称\',\r\n   englishName          varchar(32) comment \'代码英文名\',\r\n   summary              varchar(128) comment \'代码介绍\',\r\n   path                 varchar(128) comment \'代码根目录\',\r\n   state                char(10) comment \'状态：[启用Enable，停用Disable]\',\r\n   primary key (id, code)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'代码库\';\r\n\r\n\r\n/*==============================================================*/\r\n/* Table: device_history                                        */\r\n/*==============================================================*/\r\ncreate table device_history\r\n(\r\n   id                   bigint not null auto_increment,\r\n   deviceCode           varchar(64) not null comment \'设备编码\',\r\n   codeBaseCode         varchar(64) not null comment \'代码编码\',\r\n   path                 varchar(64) comment \'临时代码目录\',\r\n   createTime           datetime comment \'创建时间\',\r\n   primary key (id, deviceCode, codeBaseCode)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'设备使用历史\';\r\n\r\n\r\n/*==============================================================*/\r\n/* Table: device_pool                                           */\r\n/*==============================================================*/\r\ncreate table device_pool\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'设备编码\',\r\n   codeName             varchar(32) not null comment \'设备编号\',\r\n   schoolCode           varchar(64) not null comment \'学校编码\',\r\n   schoolCodeName       varchar(32) comment \'学校编号\',\r\n   ip                   varchar(32) comment \'当前ip\',\r\n   createTime           datetime comment \'创建时间\',\r\n   updateTime           datetime comment \'更新时间\',\r\n   lastOnlineTime       datetime comment \'上次在线时间\',\r\n   state                varchar(16) comment \'状态[下线OffLine，上线OnLine，使用中 Using ]\',\r\n   token                varchar(32) comment \'当前token\',\r\n   os                   varchar(32) comment \'os版本信息\',\r\n   summary              varchar(128) comment \'备注最多128个英文字符或64个汉字\',\r\n   primary key (id, code, codeName, schoolCode)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'设备池\';\r\n\r\n/*==============================================================*/\r\n/* Table: school                                                */\r\n/*==============================================================*/\r\ncreate table school\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   name                 varchar(64) comment \'学校名称\',\r\n   codeName             varchar(32) not null comment \'学校代码\',\r\n   phone                varchar(16) comment \'联系方式\',\r\n   state                varchar(16) comment \'状态：[启用Enable，停用Disable]\',\r\n   num                  int default 0 comment \'拥有设备数量\',\r\n   address              varchar(128) comment \'地址\',\r\n   createTime           datetime comment \'创建时间\',\r\n   primary key (id, code, codeName)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'学校\';\r\n\r\n\r\n/*==============================================================*/\r\n/* Table: school_wifi                                           */\r\n/*==============================================================*/\r\ncreate table school_wifi\r\n(\r\n   id                   bigint not null auto_increment,\r\n   schoolCode           varchar(64) not null comment \'学校编码\',\r\n   ssid                 varchar(32) comment \'wifiname\',\r\n   password             varchar(32) comment \'密码\',\r\n   state                varchar(16) comment \'状态：[启用Enable，停用Disable]\',\r\n   createTime           datetime comment \'创建时间\',\r\n   primary key (id, schoolCode)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'学校wifi\';\r\n\r\n\r\nCREATE TABLE `setting` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `k` varchar(64) NOT NULL COMMENT \'键\',\r\n  `v` varchar(128) DEFAULT NULL COMMENT \'值\',\r\n  `summary` varchar(256) DEFAULT NULL COMMENT \'备注 128个汉字\',\r\n  `ver` int(11) DEFAULT 1 COMMENT \'版本\',\r\n  PRIMARY KEY (`id`,`k`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COMMENT=\'设置\';\r\n\r\n\r\n\r\ndrop table if exists nat_traverse_port;\r\n\r\n/*==============================================================*/\r\n/* Table: nat_traverse_port                                     */\r\n/*==============================================================*/\r\ncreate table nat_traverse_port\r\n(\r\n   id                   bigint not null auto_increment,\r\n   code                 varchar(64) not null comment \'编码\',\r\n   port                 varchar(32) comment \'端口\',\r\n   type                 varchar(16) comment \'类型 SSH,WEB\',\r\n   state                varchar(16) comment \'状态[空闲Free,使用中 Using]\',\r\n   primary key (id, code)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT=\'内网穿透可用端口\';\r\n\r\n\r\n\r\ndrop table if exists device_online;\r\n\r\n/*==============================================================*/\r\n/* Table: device_online                                         */\r\n/*==============================================================*/\r\ncreate table device_online\r\n(\r\n   id                   bigint not null auto_increment,\r\n   schoolCode           varchar(64) not null comment \'学校编码\',\r\n   deviceCode           varchar(64) not null comment \'设备编码\',\r\n   deviceCodeName       varchar(32) not null comment \'设备代码\',\r\n   schoolCodeName       varchar(32) not null comment \'学校代码\',\r\n   natTraversePortCode  varchar(64) not null comment \'端口编码\',\r\n   state                varchar(16) comment \'状态：等待上线 Waiting，上线Online，下线 Offline\',\r\n   type                 varchar(16) comment \'类型 SSH,WEB\',\r\n   domain               varchar(32) comment \'域名\',\r\n   heartTime            datetime comment \'最后一次心跳时间\',\r\n   primary key (id, schoolCode, deviceCode, deviceCodeName, schoolCodeName, natTraversePortCode)\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT=\'在线设备\';', 'Enable');
INSERT INTO `project_sql` VALUES ('180', '1335479742375624704', '1335480240591831040', 'DROP DATABASE if EXISTS jv_rover_demo;\nCREATE DATABASE jv_rover_demo;\nUSE jv_rover_demo;\nCREATE TABLE `device_used_logs` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `schoolCode` varchar(64) NOT NULL COMMENT \'学校编码\',\r\n  `schoolName` varchar(64) NOT NULL COMMENT \'学校代码\',\r\n  `deviceCode` varchar(64) NOT NULL COMMENT \'设备编码\',\r\n  `deviceCodeName` varchar(32) NOT NULL COMMENT \'设备代码\',\r\n  `ip` varchar(64) NOT NULL COMMENT \'ip\',\r\n  `event` varchar(16) DEFAULT NULL COMMENT \'事件：初始化 Init，上线 Online，绑定 Bind， 执行代码 ExecCode\',\r\n  `summary` varchar(32) DEFAULT NULL COMMENT \'说明\',\r\n  `createTime` datetime DEFAULT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`,`schoolCode`,`deviceCode`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'设备使用日志\';\r\n\r\n', 'Enable');
